function readline() {
    return input[readCount++];
}


function fire() {
    var start = new Date();
    var nrOfGames = parseInt(readline());
    for (var i = 0; i < nrOfGames; i++) {
        solveForBoard(readBoard());
    }
    var end = new Date();
    //print('time:');
    //print(end - start);
}

function solveForBoard(data) {
    var board = data.board;
    var visited = {};

    var queue = data.fires;
    queue.unshift(data.start); // possible to optimize
    print('hei');

    while (true) {
        var node = queue.shift();

        if (!node) {
            break;
        }

        if (node.type == 'me' && isAtEdge(node, board)) {
            print(node.distance + 1);
            return;
        }

        if (node.type == 'me' && board.data[node.y][node.x] == '*') {
            continue; // fire arrived here since last iteration :(
        }

        var neighborNodes = [
            {x: node.x + 1, y: node.y, type: node.type},
            {x: node.x - 1, y: node.y, type: node.type},
            {x: node.x, y: node.y + 1, type: node.type},
            {x: node.x, y: node.y - 1, type: node.type}
        ];

        for (var i = 0; i < 4; i++) {
            var newNode = neighborNodes[i];


            if (isOutsideEdge(newNode, board) || board.data[newNode.y][newNode.x] != '.') {
                continue;
            }

            if (node.type == 'me' && !visited[newNode.x + '-' + newNode.y]) {
                visited[newNode.x + '-' + newNode.y] = true;
                newNode.distance = node.distance + 1;
            } else {
                board.data[newNode.y][newNode.x] = '*';
            }

            queue.push(newNode);

        }


    }

    print('IMPOSSIBLE');

}

function isAtEdge(node, board) {
    return (node.x == 0 || node.x == board.maxX || node.y == 0 || node.y == board.maxY);
}

function isOutsideEdge(node, board) {
    return (node.x < 0 || node.x > board.maxX || node.y < 0 || node.y > board.maxY);
}


function readBoard() {
    var sizes = readline().split(' ');

    var board = [];
    var fires = [];
    var startPos;

    for (var i = 0; i < sizes[1]; i++) {
        var line = readline().split('');
        board.push(line);

        for (var k = 0; k < line.length; k++) {
            if (line[k] == '@') {
                line[k] = '.';
                startPos = {x: k, y: i, type: 'me', distance: 0};
            } else if (line[k] == '*') {
                fires.push({x: k, y: i, type: 'fire'});
            }
        }
    }

    return {
        board: {
            maxX: sizes[0] - 1,
            maxY: sizes[1] - 1,
            data: board
        },
        fires: fires,
        start: startPos
    }
}

fire();
